import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart to have something to update
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();

    // Wait for cart count to update (implicitly waits for add to cart action to complete)
    await page.waitForSelector('.cart:has-text("1")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // 3. Extract initial quantity
    const initialQuantity = await page.locator('.cart-item .quantity').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // 4. Click the '+' button to increase the quantity
    await page.locator('.cart-item button:has-text("+")').click();

    // 5. Wait for the quantity text to update to '2'
    await page.waitForFunction(() => {
        const quantityElement = document.querySelector('.cart-item .quantity');
        return quantityElement && quantityElement.innerText.trim() === '2';
    }, null, { timeout: 5000 });

    // 6. Extract the final quantity
    const finalQuantity = await page.locator('.cart-item .quantity').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2",
      extractedData: {
        initialQuantity: initialQuantity.trim(),
        finalQuantity: finalQuantity.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
